import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

const App = () => {
  return (
    <Router>
      <div className='menu'>
        <ul>
          <li>
            <Link to='/'>TRANG CHỦ</Link>
          </li>
          <li>
            <Link to='/gio-hang'>GIỎ HÀNG</Link>
          </li>
          <li>
            <Link to='/admin'>ADMIN</Link>
          </li>
        </ul>
      </div>

      <Switch>
        <Route exact path='/'>
          {/* Component hoặc nội dung trang chủ */}
        </Route>
        <Route path='/gio-hang'>
          {/* Component hoặc nội dung trang giỏ hàng */}
        </Route>
        <Route path='/admin'>
          {/* Component hoặc nội dung trang admin */}
        </Route>
      </Switch>
    </Router>
  );
};

export default App;
